import React from "react";
// import PropTypes from "prop-types";
import { Container, Row, Col } from "shards-react";

import PageTitle from "./../components/common/PageTitle";
import Gmap from "./../components/maps/Gmap";

const Home = (props) => (
  <Container fluid className="main-content-container px-4">
    {/* Page Header */}
    <Row noGutters className="page-header py-4">
      <PageTitle title="Where is my car?!" subtitle="Dashboard" className="text-sm-left mb-3" />
    </Row>

    <Row>
      <Col>
        <Gmap
          isMarkerShown={false}
          googleMapURL="http://maps.google.com/maps/api/js?key=AIzaSyBmXrI47m1cRcvkozno6qCzRq_R4CxbPWI"
          loadingElement={<div style={{ height: `100%` }} />}
          containerElement={<div {...props} style={{ height: '450px' }} />}
          mapElement={<div style={{ height: `100%` }} />}
        />
      </Col>
    </Row>
  </Container>
);

export default Home;
